window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"18.0.0","implementation":{"name":"cucumber-jvm","version":"7.4.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"11.0.20.1+1"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1703250573,"nanos":999343800}}},{"source":{"uri":"file:///C:/Users/user/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US18_Ismail.feature","data":"\r\nFeature: US18 : As a registered user, I want to have a page where I can see my Credit plans and get Credit.\r\n\r\n  Background:Users use these steps to log in to the site.\r\n\r\n    * The visitor enters the site with the given \"Url\"\r\n\r\n\r\n  Scenario: TC01 : In order to manage loan transactions on the Dashboard page,\r\n            there must be a \"Take Loan\" link element in the navbar on the left and it must be verified that\r\n            when clicked, it is directed to the \"Loan Plans\" page.\r\n\r\n    * Click on the login button\r\n    * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n    * Registered user \"password\" is entered in the Your Password box.\r\n    * Click on the login button to log in.\r\n    * Verify that the Take Loan tab is visible\r\n    * Click on the Take Loan button\r\n    * Verify that Loan Plans appears\r\n    * Close the page\r\n\r\n\r\n    Scenario: TC02 : When the Car Loan 2 button is clicked on the Loan Plans page,\r\n              the \"Personal Finance Loan\" card and Take Minimum $2,000.00 Take Maximum $5,000.00\r\n              Per Installment 4% Installment Interval 20 Days Total Installment 20 information\"\r\n              and the \"Apply Now\" button will appear and verify that it is active\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the car loan button\r\n      * Verify that Personal Finance Loan is visible\r\n      * Verify that Take Maximum is visible\r\n      * Verify that \"$2,000.00\" is visible\r\n      * Verify that Take Minimum is visible\r\n      * Verify that the \"$5,000.00\" is visible\r\n      * Verify that Per Installment is visible\r\n      * Verify this \"4%\" is visible\r\n      * Verify that Installment Interval is visible\r\n      * Verify that 20 Days is visible\r\n      * Verify that Total Installment is visible\r\n      * Verify that 20 is visible\r\n      * Verify that Apply Now is visible\r\n      * Verify that the Apply Now button is clickable\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC03 : It must be verified that when the Apply Now button is clicked,\r\n              you can go to the \"Apply for Personal Finance Loan\" page.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the car loan button\r\n      * Click on the Apply Now button\r\n      * Verify that Apply for Personal Finance Loan appears\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC04 : On the \"Apply for Personal Finance Loan\" page,\r\n              the \"Amount\" value \"Minimum Amount $2,000.00 -Maximum Amount $5,000.00\"\r\n              should be entered and the \"Confirm\" button should be visible and active and when clicked,\r\n              a successful registration should be confirmed.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the car loan button\r\n      * Click on the Apply Now button\r\n      * A number between \"2000\" and \"5000\" is entered in the Enter An Amount box\r\n      * Verify that Confirm text is visible\r\n      * Click on the Confirm button\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC05 : When the \"Basic Loan\" button is clicked on the Loan Plans page,\r\n              the titles \"Basic Loan 1\",\"Test_Loan\",\"Car Loan 9\" should be seen and the \"Apply Now\" button\r\n              under any card should be visible and it should be verified that it is active.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Verify that Apply Now is visible\r\n      * Verify that the Apply Now button is clickable\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC06 : When the Apply Now button is clicked, an \"Amount\" value\r\n              within the range of \"Take Minimum / Take Maximum\" values should be entered.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the basic Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Verify that Application Form text is visible\r\n      * Close the page\r\n\r\n\r\n    Scenario: T07 :  Plan Name, Loan Amount, Total Installment, Per Installment, You'll Need To Pay,\r\n              Application Fee\" fields became visible under the heading\r\n              \"You are applying to take loan (Be Sure Before Confirm)\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the basic Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Verify that Plan Name appears\r\n      * Verify that Loan Amount appears\r\n      * Verify that Total Installment appears\r\n      * Verify that Per Installment appears\r\n      * Verify that You'll Need To Pay appears\r\n      * Verify that Application Fee text is visible\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC08 : It must be verified that the selected loan card name and the \"Apply\" button\r\n              are visible under the Application Form heading.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the Test Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Verify that Application Form appears\r\n      * Verify that Test Loan is written in the box under Application Form\r\n      * Verify that Apply appears\r\n      * Close the page\r\n\r\n\r\n      Scenario: TC09 : It should be verified that the \"Loan application submitted successfully\"\r\n                message appears when the Apply button is clicked.\r\n\r\n        * Click on the login button\r\n        * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n        * Registered user \"password\" is entered in the Your Password box.\r\n        * Click on the login button to log in.\r\n        * Click on the Take Loan button\r\n        * Click on the basic loan button\r\n        * Click on the Test Loan Apply Now button\r\n        * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n        * Click on the Confirm button\r\n        * Click on the Apply button under the Application Form Text\r\n        * Verify that the Loan application submitted successfully message appears\r\n        * Close the page\r\n\r\n\r\n    Scenario: TC10 : It must be verified that the transaction made on the My Loans page is visible\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the Test Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Click on the Apply button under the Application Form Text\r\n      * Verify that Test_Loan appears\r\n      * Close the page\r\n\r\n\r\n  Scenario: TC11 : To search for a transaction, the \"Search By Loan Number\" text box must be visible and active.\r\n            It must be verified that filtering can be done under the \"Loan Status\" heading.\r\n\r\n    * Click on the login button\r\n    * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n    * Registered user \"password\" is entered in the Your Password box.\r\n    * Click on the login button to log in.\r\n    * Click on the Take Loan button\r\n    * Click on the basic loan button\r\n    * Click on the Test Loan Apply Now button\r\n    * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n    * Click on the Confirm button\r\n    * Click on the Apply button under the Application Form Text\r\n    * Verify that the Search By Loan Number text box is visible\r\n    * The last created Test_LOan Loan number is entered into the Search By Loan Number text box.\r\n    * Click on the lens logo\r\n    * Test_Loan Verifies that the Loan number appears in the table as uniq\r\n    * Click on the arrow sign in the Loan Status box select \"pending\" status from the dropdown menu that opens.\r\n    * It is verified that pending status codes are displayed filtered in the table.\r\n    * Close the page\r\n\r\n\r\n    Scenario: TC12 : The \"Installments\" button must be visible and active for\r\n              the running process on the My loans page. Clicking\r\n              the button verifies that the \"Loan Installments\" page is accessible\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the Test Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Click on the Apply button under the Application Form Text\r\n      * Click on the arrow sign in the Loan Status box select \"running\" status from the dropdown menu that opens.\r\n      * Click on the running button\r\n      * Verify that the Installment box is visible in the bar that opens\r\n      * Verify that the Installment box is clickable\r\n      * Click on the Installment box\r\n      * Verify that Loan Installments is displayed on the page that opens\r\n      * Close the page\r\n\r\n\r\n      Scenario: TC13 : The \"Installments\" button must be visible and active for\r\n                the running process on the My loans page. Clicking the button verifies\r\n                that the \"Loan Installments\" page is accessible\r\n\r\n        * Click on the login button\r\n        * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n        * Registered user \"password\" is entered in the Your Password box.\r\n        * Click on the login button to log in.\r\n        * Click on the Take Loan button\r\n        * Click on the basic loan button\r\n        * Click on the Test Loan Apply Now button\r\n        * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n        * Click on the Confirm button\r\n        * Click on the Apply button under the Application Form Text\r\n        * Click on the arrow sign in the Loan Status box select \"running\" status from the dropdown menu that opens.\r\n        * Click on the running button\r\n        * Click on the Installment box\r\n        * Verify that the Loan Number value appears\r\n        * Verify that the Loan Amount value appears\r\n        * Verify that the Plan value appears\r\n        * Verify that the value Per Installment appears\r\n        * Verify that the Needs to Pay value appears\r\n        * Verify that the Delay Charge value appears\r\n        * Close the page\r\n\r\n\r\n  Scenario: TC14 : Verify that the installment plan list is displayed\r\n\r\n    * Click on the login button\r\n    * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n    * Registered user \"password\" is entered in the Your Password box.\r\n    * Click on the login button to log in.\r\n    * Click on the Take Loan button\r\n    * Click on the basic loan button\r\n    * Click on the Test Loan Apply Now button\r\n    * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n    * Click on the Confirm button\r\n    * Click on the Apply button under the Application Form Text\r\n    * Click on the arrow sign in the Loan Status box select \"running\" status from the dropdown menu that opens.\r\n    * Click on the running button\r\n    * Click on the Installment box\r\n    * The installment plan list should be displayed.\r\n    * Close the page\r\n\r\n\r\n    Scenario: TC15 : List headings (S.N.,Installment Date,Given On,Delay)\r\n              Headings should be displayed. It should be verified that the values are visible in the list.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the Test Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Click on the Apply button under the Application Form Text\r\n      * Click on the arrow sign in the Loan Status box select \"running\" status from the dropdown menu that opens.\r\n      * Click on the running button\r\n      * Click on the Installment box\r\n      * Verify that the S.N. Header is displayed\r\n      * Verify that the Installment Date Header is displayed\r\n      * Verify that the Given On Header is displayed\r\n      * Verify that the Delay Header is displayed\r\n      * Close the page\r\n\r\n  @wip\r\n    Scenario: TC16 : To move from the My Loans page to the Take Loan page,\r\n              the \"Take Loan\" button appears and must be verified as active.\r\n\r\n      * Click on the login button\r\n      * The registered \"usernameIsmail\" is entered in the Username Or Email box.\r\n      * Registered user \"password\" is entered in the Your Password box.\r\n      * Click on the login button to log in.\r\n      * Click on the Take Loan button\r\n      * Click on the basic loan button\r\n      * Click on the Test Loan Apply Now button\r\n      * A number between \"5000\" and \"15000\" is entered in the Enter An Amount box\r\n      * Click on the Confirm button\r\n      * Click on the Apply button under the Application Form Text\r\n      * Verify that the Take Loan tab is visible\r\n      * Click on the Take Loan button\r\n      * Verify that Loan Plans appears on the page that opens\r\n      * Close the page\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/user/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US18_Ismail.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"US18 : As a registered user, I want to have a page where I can see my Credit plans and get Credit.","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"Users use these steps to log in to the site.","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"* ","text":"The visitor enters the site with the given \"Url\"","id":"ff9d039e-6de2-49a7-81cc-85f425db61c6"}],"id":"51f1a8ad-595f-4b00-8082-0ff36e2e3538"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"TC01 : In order to manage loan transactions on the Dashboard page,","description":"            there must be a \"Take Loan\" link element in the navbar on the left and it must be verified that\n            when clicked, it is directed to the \"Loan Plans\" page.","steps":[{"location":{"line":13,"column":5},"keyword":"* ","text":"Click on the login button","id":"7f62f36a-f309-4706-b2d0-cabe2a1d9dad"},{"location":{"line":14,"column":5},"keyword":"* ","text":"The registered \"usernameIsmail\" is entered in the Username Or Email box.","id":"059a99af-f42e-4b51-bb3e-d0019abd2fb5"},{"location":{"line":15,"column":5},"k ,{"testCaseFinished":{"testCaseStartedId":"7b84a8f5-d7e4-4412-8c03-d5d452e55dd7","timestamp":{"seconds":1703250591,"nanos":382136300},"willBeRetried":false}},{"source":{"uri":"file:///C:/Users/user/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US37_Halit.feature","data":"\r\n  @US_37\r\n    Feature: As an Administrator, I want to have a page on the site where I can see active users and manage balance\r\n      transactions.\r\n\r\n      Background:  Background: In this step, the registered user reaches the user home page\r\n      by entering his username and password.\r\n        * The administrator goes to the web page with the given \"adminUrl\".\r\n        * The administrator enters a valid \"usernameHalit\" in the username box.\r\n        * The administrator enters a valid \"passwordAdmin\" in the password box.\r\n        * The administrator clicks on the login button.\r\n        * The administrator clicks the manage users button under the Dashboard.\r\n\r\n      Scenario: TC_01 The 'Active Users' link should appear and be active under the 'Manage Users'\r\n            link in the Naw bar on the Dashboard page.\r\n\r\n        * Verify that the Active Users button is visible and active.\r\n\r\n      Scenario: TC_02 When the 'Active Users' link is clicked, the 'Active Users List' and list\r\n      titles should be displayed.\r\n\r\n        * The administrator clicks Active Users button\r\n        * Verify that the  Active Users List and list titles appears.\r\n\r\n\r\n      Scenario: TC_03 To access information about any user selected from the list, the 'Details'\r\n      button must be visible and active. When clicked, it should redirect to the 'User Detail - Username' page.\r\n\r\n        * The administrator clicks Active Users button\r\n        * Verify that the Details button is visible and active.\r\n        * The administrator clicks  the Details button.\r\n        * It is verified that the User Details-Username page is opened.\r\n\r\n      Scenario: TC_04 On the User Detail page, under the 'Balance' heading, the 'view all' icon should be\r\n      visible and active. When the icon is clicked, it should direct you to the 'Transaction Logs' page.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * It is verified that the Transaction Logs page is opened.\r\n\r\n      Scenario: TC_05 List and list titles should be displayed on the page that opens.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * It is verified that the list and list titles are displayed on the Transaction Logs page.\r\n\r\n      @a\r\n      Scenario: TC_06 To search within the list, filter icons must be visible and active.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * The TRX Username box appears and confirms that it is active.\r\n        * The Type box appears and confirms that it is active.\r\n        * The Remark box appears and confirms that it is active.\r\n        * The Date box appears and confirms that it is active.\r\n        * The filter icon appears and confirms that it is active.\r\n\r\n      @wip\r\n      Scenario: TC_07 The 'Add Balance' Button should be visible and active on the Active Users Page. When\r\n      clicked, it should direct you to the Add Balance page.\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The Add Balance button appears and confirms that it is active.\r\n        * The administrator clicks Add Balance button.\r\n        * It is verified that the Add Balance page is opened.\r\n\r\n      @wip\r\n      Scenario: TC_08 The Amount and Remark text boxes on the Add Balance page should be visible and\r\n          characters should be entered.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks Add Balance button.\r\n        * Amount text box appears and it is verified that characters can be entered.\r\n        * Remark text box appears and it is verified that characters can be entered.\r\n      @wip\r\n      Scenario: The 'Submit Button' on the page must be visible and active. When clicked, the text\r\n      '$x added successfully' should be displayed.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks Add Balance button.\r\n        * The amount is entered in the Amount text box.\r\n        * A description is entered in the Remark text box.\r\n        * The Submit button appears and confirms that it is active.\r\n        * The administrator clicks Submit button.\r\n        * It is verified that the text $ 1 added successfully is seen.","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/user/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US37_Halit.feature","feature":{"location":{"line":3,"column":5},"tags":[{"location":{"line":2,"column":3},"name":"@US_37","id":"f93b6c58-e325-4500-abd7-eaa6f0851034"}],"language":"en","keyword":"Feature","name":"As an Administrator, I want to have a page on the site where I can see active users and manage balance","description":"      transactions.","children":[{"background":{"location":{"line":6,"column":7},"keyword":"Background","name":"Background: In this step, the registered user reaches the user home page","description":"      by entering his username and password.","steps":[{"location":{"line":8,"column":9},"keyword":"* ","text":"The administrator goes to the web page with the giv
